import React from "react";
import { Link, useParams } from "react-router-dom";
import '../css/final.css';
import correcto from '../img/correcto.png';

const Final = () => {
  const { userId } = useParams();
    return (
      <div className='Final'>
       
        <div className="Body-Fin">
         <div className="Body-F"> 
           <img src={correcto} alt="imagencorrecto" />
           <h1>Haz creado tu perfil</h1>
           <h2>Gracias por formar parte de alliance</h2>
           <h3>Encontraras una comunidad en la que podrás mostrarte y aprovechar la información y contactos para su negocio</h3>
           <div className=''>
           <button><Link to={`/perfil/${userId}`} className='' >Ir al perfil</Link></button>
           
           </div>
          </div>
        </div>
        
      </div>
    );
}

export default Final;
